script: |
  super -f text -I q9184.spq | sort > q9184.out

inputs:
  - name: q9184.spq
    data: |
      SELECT col2 - col1 * - tab1.col1 AS col0 FROM tab1 (FORMAT parquet) WHERE ( + tab1.col2 * - col1 + - tab1.col1 ) NOT BETWEEN NULL AND - col0;
  - name: tab1

outputs:
  - name: q9184.out
    data: |
